import React , {useState} from "react";
import { Link } from "react-router-dom";
import Badge from '@mui/material/Badge';
import { styled } from '@mui/material/styles';
import logo from "../GI.png"
import DropdownMenu from './DropdownMenu';

const StyledBadge = styled(Badge)(({ theme }) => ({
  '& .MuiBadge-badge': {
    right: -3,
    top: 13,
    border: `2px solid ${theme.palette.background.paper}`,
    padding: '0 4px',
  },
}));

function Navbar() {
    const [showDropdown, setShowDropdown] = useState(false);

    const handleMouseEnter = () => {
        setShowDropdown(true);
    };

    const handleMouseLeave = () => {
        setShowDropdown(false);
    };

    return (
        <nav className="navbar p-3 d-flex align-items-center justify-content-between">
        <div className="navbar-left d-flex align-items-center">
            <Link className="navbar-logo" to="/">
            <img src={logo} alt="Logo" />
            </Link>
            <Link className="nav-tab" to="/">Home</Link>
            <Link className="nav-tab" to="/about">About Me</Link>

            <div
                className="nav-tab projects"
                onMouseEnter={handleMouseEnter}
                onMouseLeave={handleMouseLeave} >
            <Link to="/projects">Projects</Link>
            {showDropdown && <DropdownMenu />}

            </div>
        </div>
        </nav>
    );
}

export default Navbar;
